import './App.css';
import Game from './components/Game';
import HistoryMap from './components/zHistoryMap';
import TimeTravelButton from './components/TimeTravelButton';
import { Routes, Route, BrowserRouter } from 'react-router-dom'; 


const App = () => {
  return (
    <div className="App">
      <header>
        <h1>HistoryQuest: AI Time Traveler</h1>
      </header>
      <main>
        <Game />
        <TimeTravelButton />
        <HistoryMap />
      </main>
      <footer>
        <p>&copy; 2025 HistoryQuest. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
